import React from "react";
import styled from "styled-components";
import DetailWrap from "../common/DetailWrap";

const Content = ({ project }) => {
  return (
    <ContentBlock>
      <DetailWrap>
        <div>이미지</div>
        <div>소개</div>
        <div>역할</div>
        <div>활용기술</div>
      </DetailWrap>
    </ContentBlock>
  );
};

const ContentBlock = styled.section``;

export default Content;
